import React from "react";
import RentalRow from "./RentalRow";

function RentalsTable({ rentals, updateEquipment, debugMode, setSelectedRow }) {
  return (
    <table>
      <thead>
        <tr>
          {["Дата аренды", "Кто берет", "Оборудование", "Кто выдал", "Статус", "Конфликты"].map((header, index) => (
            <th key={index}>{header}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {rentals.map((rental, rowIndex) => (
          <RentalRow key={rowIndex} rental={rental} rowIndex={rowIndex} updateEquipment={updateEquipment} rentals={rentals} setSelectedRow={setSelectedRow} />
        ))}
      </tbody>
    </table>
  );
}

export default RentalsTable;
